import React, { Component } from 'react';
import { Image } from 'react-native';
import { Container, Header, View, DeckSwiper, Card, CardItem, Thumbnail, Text, Left, Body, Icon } from 'native-base';
const cards = [
  {
    place: 'Oaxaca,Oaxaca',
    stars: '4.5',
    image: require('./img/image1.jpg'),
    text: 'lorem ipsum Lorem, ipsum dolor sit amet consectetur adipisicing elite '
  },

];
export default class SwipCards extends Component {
  render() {
    return (
      <Container>
      <View>
          <DeckSwiper
            dataSource={cards}
            renderItem={item =>
              <Card style={{ elevation: 3 }}>
                 <CardItem cardBody>
          <Image
            source={item.image}
            style={{ width: null, flex: 1 }}
          />
        </CardItem>
        <CardItem>
          <Body>
            <Text>
              {item.text}
            </Text>
          </Body>
        </CardItem >
      <View style={{ 
          flexDirection: 'row',
        justifyContent: 'space-between'        
         }}>
          <View>
            <Icon active name="navigate" />
            <Text>{item.place}</Text>
            </View>


          <View >
            <Icon active name="star" />
            <Text>
              {item.stars}
            </Text>
          </View >
          </View >
      </Card>
            }
          />
        </View>
      </Container>
    );
  }
}
